import Homepage from './Components/Homepage';


function App() {
  return (
    <div className="App">
      <Header />
      {/* <Routes> */}
      <Route exact path="/" component={Homepage } />
    {/* </Routes> */}
      <Footer />

    </div>
  );
}

export default App;
